import './App.css';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

import Homepage from './Homepage.js';
import Contact from './Contact.js';

function App() {
  return (

    <div className="App">
      <Homepage />
      <Router>
    <Switch>
      <Route path="/" exact component={Homepage} />
      <Route path="/contact" component={Contact} />
    </Switch>
  </Router>
    </div>

  );

}

export default App;
